import React from "react";

const Button = ({ name, rounded }) => {
  return (
    <>
      {rounded ? (
        <button class="">{name}</button>
      ) : (
        <button class="px-7 py-4 bg-[#F86061] text-white rounded-xl text-md hover:opacity-80 transition-all">
          {name}
        </button>
      )}
    </>
  );
};

export default Button;
